import React from 'react';

const Listings = () => {
    return (
       <Section>
           <Container>
               <Heading>
                   <h1>See our areas</h1>
               </Heading>
               <InfoRow>
                   <InfoWrap>
                   <Image src='' alt='areas' />
                   <h2>8 bed 10 bath House in Venice, California</h2>
                   <InfoLink to='home'>
                            <p>View Ski Areas</p>
                            <Arrow/>
                   </InfoLink>
                   </InfoWrap>
               </InfoRow>
           </Container>
       </Section>
    );
};

export default Listings;
